    "Crew Autonomy Measures and Models (CAMM) Project",nt"tracking_summary": {ntt"total":
    1,ntt"recent": 1nt},nt"groups": [],nt"relationships_as_subject":
    [],nt"revision_timestamp": "2015-05-07T03:33:54.914868",nt"name": "crew-autonomy-measures-and-models-camm-project",nt"isopen":
    true,nt"url": null,nt"notes": "SA Technologies will employ a two-part solution
    including measures and models for evaluating crew autonomy in exploratory space
    missions. An integrated measurement and modeling approach will support NASA scientists
    in determining the optimal levels of crew autonomy under various mission conditions
    and constraints. Research results will produce a measurement application that provides
    multiple standard and custom tools for direct assessment of team autonomy and related
    constructs like team processes, social and performance outcomes, workload and situation
    awareness. The computer-based measurement application will support data collection,
    review, and high-level analysis of results. The models of crew autonomy will be
    theoretical and computer-based. Prescriptive, theoretical models support understanding
    the interrelationships among the key factors associated with performance and crew
    autonomy. Computer models will include important mission parameters and operationally-defined
    levels of crew autonomy to enhance capability for predicting outcomes associated
    with various crew autonomy levels. Phase I research will focus on defining factors
    associated with mission outcomes and crew autonomy levels, along with development
    concepts for the measurement application and modeling tool.  Phase II will involve
    development of a functional prototype of the Crew Autonomy Measures and Models (CAMM).",nt"license_title":
